def get_process(data):
    url = "https://i.51job.com/userset/ajax/apply.php?"
    params = {
        "0.7836752502267508": "",
        "jsoncallback": "jQuery18303722678211137638_1617023815208",
        f"cvinfo[{data['cvlogid']}][cvlogid]": f"{data['cvlogid']}",
        f"cvinfo[{data['cvlogid']}][time]": f"{data['time_']}",
        f"cvinfo[{data['cvlogid']}][pass]": "1",
        "_": "1617024533044",
    }
    headers = {
        "Cookie": cookies,
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/89.0.4389.90 Safari/537.36",
        "X-Requested-With": "XMLHttpRequest",
    }
    wb_data = requests.get(url=url, params=params, headers=headers)

    wb_data = re.sub(
        "jQuery18303722678211137638_1617023815208\(", "", wb_data.text)
    wb_data = re.sub("}\)", "}", wb_data)
    wb_data = json.loads(wb_data)
    lable_res = re.compile("<label>([\u4e00-\u9fa5]+)</label>", re.S)
    time_res = re.compile("<span>(.*?)</span>", re.S)
    div_res = re.compile("<div>(.*?)</div>", re.S)
    lables = re.findall(lable_res, str(wb_data))
    times = re.findall(time_res, str(wb_data))
    divs = re.findall(div_res, str(wb_data))
    lists = []
    for lable, time_, div in zip(lables, times, divs):
        out_data = {
            "lable": lable,
            "time_": time_,
            "div": div,
        }
        lists.append(out_data)
    data["info"] = lists
    print(data)
    f.write(data["title"])
    f.write(",")
    f.write(data["company"])
    f.write(",")
    f.write(data["price"])
    f.write(",")
    f.write(data["address"])
    f.write(",")
    f.write(data["people"])
    f.write(",")
    f.write(data["apply_time"])
    f.write(",")
    f.write(str(data["info"]))
    f.write("\n")
    f.flush()

    time.sleep(0.5)


def get_positions(page):
    url = "https://i.51job.com/userset/my_apply.php?"
    params = {
        "page": f"{page}",
        "lang": "c",
        "type": "sh",
        "tagType": "all",
    }
    headers = {
        "Cookie": cookies,
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/89.0.4389.90 Safari/537.36",
        "X-Requested-With": "XMLHttpRequest",
    }

    wb_data = requests.get(url=url, params=params, headers=headers)
    wb_data.encoding = 'gbk'
    et = etree.HTML(wb_data.text)
    titles = et.xpath('//*[@class="apox"]/div/div[1]/a[1]/@title')
    companys = et.xpath('//*[@class="apox"]/div/div[1]/a[2]/@title')
    prices = et.xpath('//*[@class="apox"]/div/div[1]/span[1]/@title')
    addresss = et.xpath('//*[@class="apox"]/div/div[1]/span[2]/@title')
    cvlogids = et.xpath('//*[@class="apox"]/div/div[4]/div[2]/input[1]/@id')
    times = et.xpath('//*[@class="apox"]/div/div[4]/div[2]/input[2]/@value')
    peoples = et.xpath('//*[@class="apox"]/div/div[3]/div/span/text()')
    apply_times = et.xpath(
        '//*[@class="apox"]/div/div[2]/div[1]/span[1]/text()')
    for title, price, address, cvlogid, time_, people, apply_time, company in zip(titles, prices, addresss, cvlogids, times, peoples, apply_times, companys):
        cvlogid = re.sub("cv", "", cvlogid)
        out_data = {
            "title": title,
            "company": company,
            "price": price,
            "address": address,
            "cvlogid": cvlogid,
            "time_": time_,
            "people": people,
            "apply_time": apply_time,
        }
        get_process(data=out_data)
    page += 1
    if len(times) >= 15:
        time.sleep(1)
        get_positions(page=page)


